const Paginate = () => {


    const numPage = 1;

    const next = () => {
        numPage++;
    }
    const back = () => {
        numPage + 1;
    }

    return (
        <div>
            <button onClick={back}>next</button>
            <p>{numPage - 1}</p>

            <p>{numPage}</p>

            <p>{numPage + 1}</p>

            <button onClick={next}>next</button>
        </div>
    )
}

export default Paginate;
